"dialogs/paid_channel.html":'<div class="paid-channel-info">[[This is a paid channel, which requires a recurring subscription payment to view the content. To find out more about this channel visit <span class="channel-url">www.youtube.com/user/{{model.channel.userId}}</span> on your computer.|Message that is displayed when user tries to subscribe to a paid channel.]]</div>',"dialogs/pairing_with_code.html":'<div class="pairing">  <div class="pairing-instructions">    <div class="pairing-title">[[Your TV code|Wizard dialog title.|10853239]]</div>    <div class="pair-code pairing-bold">{{displayPairingCode}}</div>    <div class="step-list">      <div class="step-list-title">[[Link your TV and phone|Title for an enumerated list of steps on how to link TV and phone through a pairing code.]]</div>      <div class="step">[[1. On your phone, open the YouTube app|Enumerated first step to link phone and TV through a pairing code.]]</div>      <div class="step">[[2. In your phone\'s YouTube settings, tap Watch on TV|Enumerated second step to link phone and TV through a pairing code.]]</div>      <div class="step">[[3. Tap <span class="pairing-bold">ENTER TV CODE</span> and enter the code from this screen|Enumerated third step to link phone and TV through a pairing code. \'ENTER TV CODE\' should be equivalent to the translation found here: https://tc.corp.google.com/btviewer/messagedetail?project=YouTubeUI&msgId=6405629164329737131|1641361897]]</div>    </div>  </div></div>',
