"dialogs/remote_transaction.html":'<div class="remote-transaction" role="dialog" aria-live="assertive" aria-atomic="true">  <div class="intro">    <div class="title" id="remote-transaction-intro-title">      {{model.getIntroDialogTitle()}}    </div>    <div class="subtitle">      [[It\'s quick and easy!|Reinforcement message for remote transaction flow.]]    </div>    <div class="images">      <div class="intro-image"></div>    </div>    <div class="information">      <div class="icon"></div>      <div class="message" id="remote-transaction-intro-desc">        [[Choosing CONTINUE will send a request to continue the transaction to the YouTube app of all mobile devices on your Wi-Fi network.|Legal notice that all devices on the same network will receive offer details. [CHAR LIMIT=230] ]]      </div>    </div>  </div>  <div class="assisted">    <div class="title" id="remote-transaction-assisted-title">      {{model.getAssistedDialogTitle()}}    </div>    <div class="subtitle" id="remote-transaction-assisted-desc">      {{model.getAssistedDialogSubtitle()}}    </div>    <div class="images">      <div class="assist-image"></div>    </div>    <div class="information">      [[Make sure your device is on the same Wi-Fi network as this TV. The movie will play on the TV.|Instructs user to ensure that their device and TV are connected to the same Wi-Fi network.]]    </div>    <div class="status">      <div class="icon">        <div class="circle waiting"></div>        <div class="quarter waiting">          <div class="circle waiting"></div>        </div>      </div>      <div class="searching">        [[Searching for device|Message indicating that the TV has not yet detected a mobile device that has initiated a remote transaction.]]      </div>      <div class="connected">        [[Connected to device|Message indicating that a mobile device has started the remote transaction flow.]]      </div>    </div>  </div>  <div class="completed">    <div class="title">      [[Done! Start watching now?|Message telling the user they have finished the remote transaction flow and can watch the content now.]]    </div>    <div class="subtitle">      [[Tap the button "Watch on TV" on your phone|Message telling the user they can initiate playback via tapping on the button on their phone.]]    </div>    <div class="images">      <div class="item-image" bedrock-style="background-image:url({{model.getItemImageUrl()}})"></div>    </div>    <div class="status">      <div class="icon"></div>      <div class="connected">        [[Connected to device|Message indicating that a mobile device has started the remote transaction flow.]]      </div>    </div>  </div>  <div class="error">    <div class="title" id="remote-transaction-error-title">      [[Something went wrong|Remote Transaction dialog title when there is any generic error.]]    </div>  </div>  <div class="instructional">    <div class="title" id="remote-transaction-instructional-title">[[Complete your purchase online|Remote Transaction dialog title to instruct users to purchase the content using their browser on a second device.]]</div>    <div class="item-image" bedrock-style="background-image:url({{model.getItemImageUrl()}})"></div>    <div class="step-list" id="remote-transaction-instructional-desc">      <div class="step">[[1. On your phone or computer, go to|Step 1 of instructions, telling the user to navigate to youtube.com on their phone or computer. This string is followed by a literal \'youtube.com\'.]]        <span class="important">youtube.com</span>      </div>      <div class="step">[[2. Search for your movie or show|Step 2 of instructions, telling the user to search for the movie or show they want to purchase.]]</div>      <div class="step">[[3. Complete the purchase|Step 3 of instructions, telling the user to complete the purchase.]]</div>      <div class="step">[[4. Watch it on any signed-in device|Step 4 of the instructions, telling the user that they can watch the purchased content on any device.]]</div>    </div>  </div>  <div class="pairing-code">    <div class="title">[[Complete your purchase online|Remote Transaction dialog title to instruct users to purchase the content using their browser on a second device.]]</div>    <div class="item-image" bedrock-style="background-image:url({{model.getItemImageUrl()}})"></div>    <div class="step-list">      <div class="step">[[1. On your phone or computer, go to|Step 1 of instructions, telling the user to navigate to purchase screen on their phone or computer. This string is followed by \'youtu.be/rent\' or \'youtu.be/buy\' depending on product.]]        <span class="important">{{model.getPairingUrl()}}</span>      </div>      <div class="step">[[2. Enter this code:|Step 2 of instructions, telling the user to enter following pairing code in browser. Followed by a 12-digit pairing code.]]        <div class="pairing-code-number">{{model.getPairingCode()}}</div>      </div>      <div class="step">[[3. Complete the purchase|Step 3 of instructions, telling the user to complete the purchase.]]</div>      <div class="step">[[4. The movie will play on this TV|Step 4 of the instructions, telling the user that they can watch the purchased content on this TV.]]</div>    </div>  </div>  <div class="loading">    <div class="loader"></div>  </div>  <div class="remote-transaction-buttons">    <div id="remote-transaction-button-list" class="$lightweight-list"></div>  </div></div>',
